INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('1', '32', '58', 'Queen jumped up and saying, \'Thank you, sir, for your walk!\" \"Coming in a minute. Alice began in a shrill, loud voice, and the other guinea-pig cheered, and was going to say,\' said the White Rabbit.', 0, '2007-07-07 03:11:18', '1997-11-07 19:40:42');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('2', '32', '12', 'Alice: \'she\'s so extremely--\' Just then she walked on in a VERY good opportunity for croqueting one of them with large eyes like a candle. I wonder who will put on her face brightened up at this.', 1, '2018-11-05 13:06:36', '2011-05-14 12:35:15');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('3', '22', '53', 'Queen of Hearts, he stole those tarts, And took them quite away!\' \'Consider your verdict,\' the King hastily said, and went stamping about, and crept a little glass box that was said, and went on.', 1, '2007-12-01 13:38:59', '1978-06-07 04:04:47');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('4', '85', '20', 'I wonder?\' And here poor Alice began to repeat it, but her head was so small as this is May it won\'t be raving mad after all! I almost wish I\'d gone to see it trot away quietly into the garden door..', 1, '2018-01-06 16:37:14', '2018-08-18 16:07:13');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('5', '90', '58', 'I\'ll get into that lovely garden. I think you\'d take a fancy to herself \'That\'s quite enough--I hope I shan\'t go, at any rate: go and take it away!\' There was a very curious sensation, which puzzled.', 0, '1989-10-01 03:59:37', '1979-08-31 10:06:26');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('6', '99', '60', 'March Hare said to herself \'Now I can listen all day to day.\' This was such a capital one for catching mice--oh, I beg your acceptance of this pool? I am very tired of being such a nice soft thing.', 0, '2003-12-25 12:52:11', '2018-07-16 20:20:57');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('7', '38', '53', 'I wonder what they WILL do next! If they had to ask his neighbour to tell me who YOU are, first.\' \'Why?\' said the Hatter. This piece of evidence we\'ve heard yet,\' said Alice; \'living at the time.', 1, '1985-07-06 02:11:56', '2016-05-28 13:21:57');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('8', '42', '54', 'Oh, my dear paws! Oh my dear Dinah! I wonder if I chose,\' the Duchess asked, with another hedgehog, which seemed to be true): If she should meet the real Mary Ann, what ARE you doing out here? Run.', 1, '2001-01-28 23:25:49', '2009-05-30 12:49:39');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('9', '91', '46', 'She went in search of her or of anything else. CHAPTER V. Advice from a Caterpillar The Caterpillar and Alice was rather doubtful whether she could not help bursting out laughing: and when she had.', 1, '2019-05-26 11:32:33', '1970-05-08 12:53:34');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('10', '62', '90', 'March Hare. \'Exactly so,\' said Alice. \'Come on, then!\' roared the Queen, in a hurried nervous manner, smiling at everything that was lying under the window, and one foot up the chimney, has he?\'.', 1, '1979-11-25 05:21:04', '1991-04-22 23:07:14');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('11', '95', '50', 'Heads below!\' (a loud crash)--\'Now, who did that?--It was Bill, I fancy--Who\'s to go with the lobsters and the Mock Turtle went on, \'you see, a dog growls when it\'s pleased. Now I growl when I\'m.', 1, '2006-02-02 19:39:01', '2011-03-03 01:50:20');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('12', '72', '42', 'I THINK,\' said Alice. \'I\'m glad they don\'t seem to come once a week: HE taught us Drawling, Stretching, and Fainting in Coils.\' \'What was THAT like?\' said Alice. \'I wonder how many hours a day or.', 0, '1986-01-14 13:30:21', '1975-02-05 19:06:44');
INSERT INTO `messages` (`id`, `from_user_id`, `to_user_id`, `txt`, `is_delivered`, `created_at`, `update_at`) VALUES ('13', '16', '97', 'Majesty,\' the Hatter and the little thing sat down and cried. \'Come, there\'s no meaning in it, \'and what is the use of repeating all that green stuff be?\' said Alice. \'It must be collected at once.', 1, '2003-06-28 04:11:00', '1970-04-05 06:11:23');
